function Sachin11(props){
    return(
        <div>
            <h1>Emp name  :{props.name}</h1>
           <h1> Emp code  :{props.Code}</h1>
           <h1> Emp Dipartment  :{props.dp}</h1>
            Emp salary  :<h1>{props.Sal}</h1>
        </div>
    )
}
export default Sachin11
